import React, { useState, useEffect } from 'react';
import { classifyImage, handleApiError } from '../utils/api';

const OCTClassifier = () => {
  const [selectedFile, setSelectedFile] = useState(null);
  const [preview, setPreview] = useState(null);
  const [result, setResult] = useState(null);
  const [loading, setLoading] = useState(false);
  const [error, setError] = useState(null);
  const [modelName, setModelName] = useState('mobilenet_v3');

  const handleFileSelect = (event) => {
    const file = event.target.files[0];
    if (file) {
      setSelectedFile(file);
      setPreview(URL.createObjectURL(file));
      setResult(null);
      setError(null);
    }
  };

  const handleSubmit = async () => {
    if (!selectedFile) {
      setError('Please select an image first');
      return;
    }

    setLoading(true);
    setError(null);

    try {
      const response = await classifyImage(selectedFile, modelName);
      setResult(response);
    } catch (err) {
      const errorDetails = handleApiError(err);
      setError(errorDetails.message);
    } finally {
      setLoading(false);
    }
  };

  // Cleanup preview URL when component unmounts
  useEffect(() => {
    return () => {
      if (preview) {
        URL.revokeObjectURL(preview);
      }
    };
  }, [preview]);

  return (
    <div className="max-w-4xl mx-auto p-4">
      <div className="mb-4">
        <select
          value={modelName}
          onChange={(e) => setModelName(e.target.value)}
          className="mb-4 p-2 border rounded"
        >
          <option value="mobilenet_v3">MobileNet V3</option>
          <option value="efficientnet_b0">EfficientNet B0</option>
          <option value="resnet18">ResNet 18</option>
          <option value="resnet50">ResNet 50</option>
          <option value="squeezenet1_1">SqueezeNet</option>
          <option value="mobilevit">MobileViT</option>
        </select>

        <input
          type="file"
          accept="image/*"
          onChange={handleFileSelect}
          className="mb-4"
        />

        {preview && (
          <div className="mb-4">
            <h3 className="text-lg font-bold mb-2">Selected Image</h3>
            <img src={preview} alt="Preview" className="max-w-md rounded shadow" />
          </div>
        )}

        <button
          onClick={handleSubmit}
          disabled={!selectedFile || loading}
          className={`px-4 py-2 rounded ${
            loading ? 'bg-gray-400' : 'bg-blue-500 hover:bg-blue-600'
          } text-white`}
        >
          {loading ? 'Processing...' : 'Classify Image'}
        </button>
      </div>

      {error && (
        <div className="text-red-500 mb-4">
          Error: {error}
        </div>
      )}

      {result && (
        <div className="results">
          <h3 className="text-lg font-bold mb-2">Results</h3>
          <div className="grid grid-cols-1 md:grid-cols-2 gap-4">
            <div>
              <p className="font-bold">Class: {result.class}</p>
              <p>Confidence: {result.confidence.toFixed(2)}%</p>
            </div>
            {result.gradcam && (
              <div>
                <h4 className="font-bold mb-2">Grad-CAM Visualization</h4>
                <img
                  src={`data:image/png;base64,${result.gradcam}`}
                  alt="Grad-CAM"
                  className="max-w-full rounded shadow"
                />
              </div>
            )}
          </div>
        </div>
      )}
    </div>
  );
};

export default OCTClassifier;
